const Presentation = () => {
  return (
    <div className='presentation'>
      <h1>Hello my name is Arnaud</h1>
        <h4 className='jobs'>- Web developer <br/> 
           - Software engineer <br/>
           - Web designer
        </h4>
    </div>
  )
}

export default Presentation
